import React from "react";
// import { Link } from "react-router-dom";

const Header = () => {
  return (
    <header className="header">
      <h1>A'Keia M.</h1>
      <nav>
        <ul>
          <li>
            <a href="">Portfolio</a>
          </li>
          <li>{/* <a href="">Resume</a> */}</li>
          <li>{/* <a href="">GitHub</a> */}</li>
          <li>{/* <a href="">LinkedIn</a> */}</li>
        </ul>
      </nav>
    </header>
  );
};

export default Header;
